--
--Create Users
--
PRINT 'Creating Users...'
CREATE USER [GTLClient] FROM LOGIN [GTLClient]
EXEC sp_addrolemember 'db_datareader', 'GTLClient'
EXEC sp_addrolemember 'db_datawriter', 'GTLClient'

CREATE USER [GTLAdmin] FROM LOGIN [GTLAdmin]
EXEC sp_addrolemember 'db_owner', 'GTLAdmin'
PRINT 'Users created!'
PRINT ''
