--
--Create Schemas
--
PRINT 'Creating Schemas...'
GO
CREATE SCHEMA [LibraryItems] AUTHORIZATION [GTLClient];
GO
CREATE SCHEMA [People] AUTHORIZATION [GTLClient];
GO
CREATE SCHEMA [Location] AUTHORIZATION [GTLClient];
GO
CREATE SCHEMA [Auditing] AUTHORIZATION [GTLAdmin];
GO
CREATE SCHEMA [Views] AUTHORIZATION [GTLClient];
GO
GRANT SELECT, UPDATE, INSERT, DELETE ON SCHEMA :: [Views] TO [GTLAdmin];
