--
--Create the Tables
--
PRINT 'Creating Tables...'
CREATE TABLE [LibraryItems].[Author] (
	[AuthorID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[FirstName] varchar(255),
	[LastName] varchar(255)
)

CREATE TABLE [Location].[City] (
	[CityID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[CityName] varchar(255) NOT NULL
)

CREATE TABLE [Location].[PostalCode] (
	[PostalCodeID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[City] int FOREIGN KEY REFERENCES [Location].[City]([CityID]),
	[PostalCode] varchar(20) NOT NULL
)

CREATE TABLE [Location].[Address] (
	[AddressID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[PostalCode] int FOREIGN KEY REFERENCES [Location].[PostalCode]([PostalCodeID]),
	[Street] varchar(225)
)

CREATE TABLE [People].[Campus] (
	[CampusID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[Address] int FOREIGN KEY REFERENCES [Location].[Address]([AddressID])
)

CREATE TABLE [LibraryItems].[LibraryItem] (
	[LibraryItemID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[Title] varchar(255),
	[LibraryItemType] varchar(255),
	[SubjectArea] varchar(255),
	[ItemDescription] varchar(8000),
	CONSTRAINT checkLibraryItemType CHECK ([LibraryItemType] IN ('Book', 'Rare Book', 'Map'))
)

CREATE TABLE [People].[Person] (
	[SSN] char(13) NOT NULL PRIMARY KEY,
	[Address] int FOREIGN KEY REFERENCES [Location].[Address]([AddressID]),
	[FirstName] varchar(255),
	[LastName] varchar(255),
	[Email] varchar(255),
	[Phone] varchar(255)
)

CREATE TABLE [LibraryItems].[BookAuthor] (
	[LibraryItemID] int NOT NULL FOREIGN KEY REFERENCES [LibraryItems].[LibraryItem]([LibraryItemID]),
	[AuthorID] int NOT NULL FOREIGN KEY REFERENCES [LibraryItems].[Author]([AuthorID]),
	PRIMARY KEY([LibraryItemID], [AuthorID])
)

CREATE TABLE [LibraryItems].[BookCopy] (
	[BookCopyID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[BookID] int FOREIGN KEY REFERENCES [LibraryItems].[LibraryItem]([LibraryItemID]),
	[BookStatus] varchar(255) NOT NULL,
	[ISBN] char(13),
	CONSTRAINT checkBorrowStatus CHECK ([BookStatus] IN ('Available', 'On Loan', 'Overdue', 'Destroyed', 'Sought After'))
)

CREATE TABLE [LibraryItems].[Borrow] (
    [BorrowID] int NOT NULL IDENTITY(1,1) PRIMARY KEY,
	[BorrowerSSN] char(13) FOREIGN KEY REFERENCES [People].[Person]([SSN]),
    [BookCopy] int FOREIGN KEY REFERENCES [LibraryItems].[BookCopy]([BookCopyID]),
	[BorrowDate] date NOT NULL,
	[ReturnDate] date NOT NULL
)

CREATE TABLE [People].[Member] (
	[MemberSSN] char(13) FOREIGN KEY REFERENCES [People].[Person]([SSN]) PRIMARY KEY NOT NULL,
	[CampusID] int FOREIGN KEY REFERENCES [People].[Campus]([CampusID]),
	[MembershipStartDate] date,
	[MembershipEndDate] date
)

CREATE TABLE [People].[Staff] (
	[StaffSSN] char(13) FOREIGN KEY REFERENCES [People].[Person]([SSN]) PRIMARY KEY NOT NULL,
	[StaffType] varchar(255),
	CONSTRAINT checkStaffType CHECK ([StaffType] IN ('Chief Librarian', 'Departmental Associate Librarian', 'Reference Librarian', 'Check-out Staff', 'Library Assistant'))
)

CREATE TABLE [People].[Professor] (
	[ProfessorSSN] char(13) FOREIGN KEY REFERENCES [People].[Person]([SSN]) PRIMARY KEY NOT NULL,
	[CampusID] int FOREIGN KEY REFERENCES [People].[Campus]([CampusID])
)
PRINT 'Tables created!'
PRINT ''
