--
--Create Functions
--
PRINT 'Creating Functions...'
GO
CREATE FUNCTION [Location].[GetFullAddress]
(
    @InputID int
)
RETURNS varchar(max)
AS
BEGIN
    DECLARE @Result varchar(max)
    SELECT @Result = CONCAT([Location].[PostalCode].[PostalCode], ', ', [Location].[City].[CityName], ', ', [Location].[Address].[Street])
    FROM [Location].[City]
    INNER JOIN [Location].[PostalCode] ON [Location].[PostalCode].[City] = [CityID]
    INNER JOIN [Location].[Address] ON [Location].[Address].[PostalCode] = [Location].[PostalCode].[PostalCodeID]
    WHERE [AddressID] = @InputID

    RETURN @Result
END
GO
PRINT 'Functions created!'
PRINT ''

--
--Create Views
--
PRINT 'Creating Views...'
GO
CREATE VIEW [Views].[GetBookBorrows] WITH SCHEMABINDING
AS
SELECT [LibraryItems].[BookCopy].[ISBN], [LibraryItems].[LibraryItem].[Title], CONCAT([People].[Person].[FirstName], ' ', [People].[Person].[LastName]) AS [PersonName], [LibraryItems].[BookCopy].[BookStatus], [LibraryItems].[Borrow].[BorrowDate], [LibraryItems].[Borrow].[ReturnDate]
FROM [LibraryItems].[Borrow]
INNER JOIN [People].[Person] ON [LibraryItems].[Borrow].[BorrowerSSN] = [People].[Person].[SSN]
INNER JOIN [LibraryItems].[BookCopy] ON [LibraryItems].[Borrow].[BookCopy] = [LibraryItems].[BookCopy].[BookCopyID]
INNER JOIN [LibraryItems].[LibraryItem] ON [LibraryItems].[BookCopy].[BookID] = [LibraryItems].[LibraryItem].[LibraryItemID]
GO

CREATE VIEW [Views].[GetLibraryItems] WITH SCHEMABINDING
AS
SELECT [LibraryItems].[LibraryItem].[Title], STRING_AGG(CONCAT([LibraryItems].[Author].[FirstName], ' ',[LibraryItems].[Author].[LastName]), ', ') as [AuthorsNames], [LibraryItems].[LibraryItem].[SubjectArea], [LibraryItems].[LibraryItem].[ItemDescription], [LibraryItems].[LibraryItem].[LibraryItemType]
FROM [LibraryItems].[LibraryItem]
INNER JOIN [LibraryItems].[BookAuthor] ON [LibraryItems].[LibraryItem].[LibraryItemID] = [LibraryItems].[BookAuthor].[LibraryItemID]
INNER JOIN [LibraryItems].[Author] ON [LibraryItems].[Author].[AuthorID] = [LibraryItems].[BookAuthor].[AuthorID]
GROUP BY [LibraryItems].[LibraryItem].[Title], [LibraryItems].[LibraryItem].[SubjectArea], [LibraryItems].[LibraryItem].[ItemDescription], [LibraryItems].[LibraryItem].[LibraryItemType]
GO

CREATE VIEW [Views].[GetBorrowableBookCopies] WITH SCHEMABINDING
AS
SELECT [BookCopy].[BookCopyID], [LibraryItems].[LibraryItem].[Title], STRING_AGG(CONCAT([LibraryItems].[Author].[FirstName], ' ',[LibraryItems].[Author].[LastName]), ', ') as [AuthorsNames]
FROM [LibraryItems].[BookCopy]
INNER JOIN [LibraryItems].[LibraryItem] ON [LibraryItems].[BookCopy].[BookID] = [LibraryItems].[LibraryItem].[LibraryItemID]
INNER JOIN [LibraryItems].[BookAuthor] ON [LibraryItems].[LibraryItem].[LibraryItemID] = [LibraryItems].[BookAuthor].[LibraryItemID]
INNER JOIN [LibraryItems].[Author] ON [LibraryItems].[Author].[AuthorID] = [LibraryItems].[BookAuthor].[AuthorID]
WHERE [LibraryItems].[LibraryItem].[LibraryItemType] = 'Book'
AND [LibraryItems].[BookCopy].[BookStatus] = 'Available'
GROUP BY [BookCopy].[BookCopyID], [LibraryItems].[LibraryItem].[Title]
GO

CREATE VIEW [Views].[GetMembers]
AS
SELECT [Person].[SSN], CONCAT([People].[Person].[FirstName], ' ', [People].[Person].[LastName]) AS [PersonName], 'Member' AS [Type], [Location].[GetFullAddress]([Person].[Address]) AS [Address], [Person].[Phone], [Person].[Email], [People].[Member].[MembershipStartDate], [People].[Member].[MembershipEndDate]
FROM [People].[Person]
INNER JOIN [People].[Member] ON [People].[Member].[MemberSSN] = [People].[Person].[SSN]

UNION

SELECT [Person].[SSN], CONCAT([People].[Person].[FirstName], ' ', [People].[Person].[LastName]) AS [PersonName], 'Professor' AS [Type], [Location].[GetFullAddress]([Person].[Address]) AS [Address], [Person].[Phone], [Person].[Email], NULL AS [MembershipStartDate], NULL AS [MembershipEndDate]
FROM [People].[Person]
INNER JOIN [People].[Professor] ON [People].[Professor].[ProfessorSSN] = [People].[Person].[SSN]
GO
