PRINT ''

--
--Create Triggers
--
PRINT 'Creating Triggers...'
GO
CREATE TRIGGER [BorrowAuditTrigger] ON [LibraryItems].[Borrow]
AFTER UPDATE, INSERT
AS
BEGIN
 INSERT INTO [Auditing].[BorrowAudit]
 ([BorrowID], [BorrowerSSN], [BookCopy], [BorrowDate], [ReturnDate], [ModifiedBy], [ModifiedDate])
 SELECT [inserted].[BorrowID], [inserted].[BorrowerSSN], [inserted].[BookCopy], [inserted].[BorrowDate], [inserted].[ReturnDate], SUSER_NAME(), GETDATE()
 FROM [Borrow]
 INNER JOIN [inserted] ON [Borrow].[BorrowID]=[inserted].[BorrowID]
END
GO

CREATE TRIGGER [BookCopyAuditTrigger] ON [LibraryItems].[BookCopy]
AFTER UPDATE, INSERT
AS
BEGIN
 INSERT INTO [Auditing].[BookCopyAudit]
 ([BookCopyID], [BookID], [ISBN], [BookStatus], [ModifiedBy], [ModifiedDate])
 SELECT [inserted].[BookCopyID], [inserted].[BookID], [inserted].[ISBN], [inserted].[BookStatus], SUSER_NAME(), GETDATE()
 FROM [BookCopy]
 INNER JOIN [inserted] ON [BookCopy].[BookCopyID]=[inserted].[BookCopyID]
END
GO

CREATE TRIGGER [MemberAuditTrigger] ON [People].[Member]
AFTER UPDATE, INSERT
AS
BEGIN
 INSERT INTO [Auditing].[MemberAudit]
 ([MemberSSN], [Address], [FirstName], [LastName], [Email], [Phone], [CampusID], [MembershipStartDate], [MembershipEndDate], [ModifiedBy], [ModifiedDate])
 SELECT [inserted].[MemberSSN], [People].[Person].[Address], [People].[Person].[FirstName], [People].[Person].[LastName], [People].[Person].[Email], [People].[Person].[Phone], [inserted].[CampusID], [inserted].[MembershipStartDate], [inserted].[MembershipEndDate], SUSER_NAME(), GETDATE()
 FROM [People].[Member]
 INNER JOIN [People].[Person] ON [People].[Member].[MemberSSN] = [People].[Person].[SSN]
 INNER JOIN [inserted] ON [People].[Member].[MemberSSN] = [inserted].[MemberSSN]
END
GO
