/*
Updating Status of BookCopy to 'On Loan' for loaned books.
This is only here because the site used to generate the data
had no way of discriminating on the INSERT operations which BookCopies were 'Borrowed'
*/
UPDATE [LibraryItems].[BookCopy]
SET [BookStatus] = 'On Loan'
FROM [LibraryItems].[BookCopy]
INNER JOIN [LibraryItems].[Borrow] ON [LibraryItems].[Borrow].[BookCopy] = [LibraryItems].[BookCopy].[BookCopyID]
WHERE [LibraryItems].[BookCopy].[BookCopyID] = [LibraryItems].[Borrow].[BookCopy]

